import React from "react"
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { icon } from "@fortawesome/fontawesome-svg-core";
import "./style.css"; 

export default function Navbar(){
    return(
        <div className="navbar-text">
            <h3>Most Popular</h3>
            <h3>Movies</h3>
            <h3>TV Series</h3>
            <div className="title--text">
            <h1>ANIME.TV</h1>
            </div>
            <div>
            <FontAwesomeIcon  className="search-icon" icon={icon({name: 'magnifying-glass', family: 'sharp' ,style: 'regular'})} />
            <FontAwesomeIcon className="bell-icon" icon="fa-sharp fa-light fa-bell" />
            </div>
            <h3>Login</h3>
        </div>
    )
}
